package app.registerimport androidx.compose.material3.SnackbarHostStateimport androidx.compose.runtime.Composableimport androidx.compose.runtime.rememberimport app.login.LoginScreenimport cafe.adriel.voyager.core.screen.Screenimport cafe.adriel.voyager.navigator.LocalNavigatorimport cafe.adriel.voyager.navigator.currentOrThrowobject RegisterScreen : Screen {	@Composable	override fun Content() {		val snackbarHostState = remember { SnackbarHostState() }		val navigator = LocalNavigator.currentOrThrow		RegisterContent(			snackbarHostState = snackbarHostState,			state = RegisterState(),			onEmailChange = {},			onPasswordChange = {},			onConfirmPasswordChange = {},			onRegisterClick = {},			onNavigateToLogin = { navigator.replace(LoginScreen) },			onNavigateToCreateProfile = {}		)	}}